import React from 'react';
import SearchBar from './SearchBar'
import SearchOptions from './SearchOptions'
import YearTabs from './YearTabs'

function NavBar() {
    return (
        <div>
            <YearTabs query={ propsquery } setQuery={ propssetQuery }/>
            <SearchBar onSearch={ propshandleSearch } query={ propsquery } setQuery={ propssetQuery }  isOptionShown={ propsisOptionShown } setIsOptionShown={ propssetIsOptionShown }/>
            <SearchOptions query={ propsquery } setQuery={ propssetQuery } isOptionShown={ propsisOptionShown } setIsOptionShown={ propssetIsOptionShown }/>
        </div>
    );
}

export default NavBar;
